import React from 'react';
import { Paper, Table, TableHead, TableBody, TableRow, TableCell, TextField } from '@material-ui/core';
import { styled } from '@material-ui/core';


// 'data' is an object with the format {data: []}, with the array containing the times 
function MotorDataTable({ data, onNewNum }) {
  let dataComponents = [];
  data = [];
  for (let i = 0; i < 10; i++) {
    data.push(i);
  }

  for (let i = 0; i < data.length; i++) {
    dataComponents.push(
      <TableRow>
        <TableCell>
          {data[i]}
        </TableCell>
      </TableRow>
    )
  }

  return (
    <React.Fragment>
      <Paper style={{height: 100, overflow: 'auto'}}>
        <Table style={{margin: '20px'}}>

          <TableHead>
            <TableRow>
              <TableCell>
                <strong>Times of Activation:</strong>
              </TableCell>
            </TableRow>
          </TableHead>

          <TableBody>
            {dataComponents}
          </TableBody>

        </Table>
      </Paper>

      <div style={{display: 'flex', justifyContent: 'center'}}>
        <TextField label="Number of Records:" variant="filled" onChange={(event) => onNewNum(event.target.value)}/> 
      </div>

    </React.Fragment>
  )
}


export default MotorDataTable;
